import React from 'react';

function Nav() {
    return (
        <div>
            <div>
                <link to={'/'}>로그인</link>
                <link to={'/myPage'}>마이페이지</link>
                <p>이미지</p>
            </div>
        </div>
    );
}

export default Nav;
